#
# Delete any existing table `tbl_report_list`
#

DROP TABLE IF EXISTS `tbl_report_list`;


#
# Table structure of table `tbl_report_list`
#



CREATE TABLE `tbl_report_list` (
  `RID` int(30) NOT NULL AUTO_INCREMENT,
  `REPORT_USER_ID` int(30) DEFAULT NULL,
  `REPORT_IMAGE` longblob DEFAULT NULL,
  `INCIDENT_ID` int(30) DEFAULT NULL,
  `REPORT_DATETIME` datetime DEFAULT NULL,
  `LOCATION` text DEFAULT NULL,
  `COMMENT` longtext DEFAULT NULL,
  `DATE_CREATED` datetime DEFAULT current_timestamp(),
  `VERIFIED_DATE` datetime DEFAULT NULL ON UPDATE current_timestamp(),
  `VERIFIED_STATUS` tinyint(1) DEFAULT 0 COMMENT '0= FOR VERIFICATION,\r\n1= VERIFIED,\r\n2= DONE,\r\n3= FAKE REPORT',
  `VERIFIED_BY` varchar(255) DEFAULT NULL,
  `VERIFIED_USER_ID` int(30) DEFAULT NULL,
  `VERIFIED_REMARKS` longtext DEFAULT NULL,
  `RESPONDENT_ID` varchar(255) NOT NULL,
  PRIMARY KEY (`RID`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4;

